function widenTemporalWithZeros(oldfilters) {
    //appears to initially cause less discord.
    for (var oldfilter of oldfilters) {
        oldfilter.depth = network_size// addThisManyNewOnes * temporalSize

        for (var j = num_inputs; j < network_size; j++) {
            oldfilter.w[j] = 0
        }
    }
    return oldfilters
};

// useage: splitTmporal(1,[1,1,1,1,1,1...])
function splitTemporal(oldfilters) {
    for (var oldfilter of oldfilters) {
        oldfilter.depth = network_size// addThisManyNewOnes * temporalSize

        for (var i = 0; i < temporal_window; i++) {
            var mark = num_inputs + i * temporalSize;
            for (var j = 0; j < num_inputs; j++) {
                oldfilter.w[(j + mark)] = oldfilter.w[j]
            }
            for (var j = 0; j < num_actions; j++) {
                oldfilter.w[j + mark + num_inputs] = 0
            }

        }
    }
    return oldfilters
};

/*usage: filter: bridge(21)*/
function widen(newSize, filterSize, old) {

    var ret = []

    for (var i = 0; i < filterSize; i++) {
        var l = {"sx": 1, "sy": 1, "depth": newSize, "w": {}}
        ret.push(l)
        for (var j = 0; j < newSize; j++) {
            if (old.size > i && j in old[i].w) {
                l.w [j] = old[i].w[j]
            }
            else {
                l.w [j] = .1
            }
        }

    }
    return ret;
};
/*usage: filter: bridge(21)*/
function bridge(n) {
    var ret = []

    for (var i = 0; i < n; i++) {
        var l = {"sx": 1, "sy": 1, "depth": n, "w": {}}
        ret.push(l)
        for (var j = 0; j < n; j++) {

            l.w [j] = (i == j ? 1 : 0)
        }

    }
    return ret;
};

